desc:
&amp;lt;p&amp;gt;7分钟长的愤怒的婴儿大哭。&amp;lt;/p&amp;gt;

&amp;lt;p&amp;gt;当你使用这个声音时，如果你自愿捐献给freesound就更好了。 &amp;lt;br&amp;gt;如果你使用这个声音，你必须在你的作品中注明我（klankbeeld）和freesound.org。像这样做：声音来自&amp;lt;a href=&amp;quot;http://www.freesound.org/people/klankbeeld/&amp;quot; rel=&amp;quot;nofollow&amp;quot;&amp;gt;http://www.freesound.org/people/klankbeeld/&amp;lt;/a&amp;gt;&amp;lt;/p&amp;gt。

&amp;lt;p&amp;gt;不要使用间接链接。&amp;lt;/p&amp;gt。

&amp;lt;p&amp;gt;&amp;lt;a href=&amp;quot;http://www.pledgie.com/campaigns/20016&amp;quot; rel=&amp;quot;nofollow&amp;quot;&amp;gt;&amp;lt;/a&amp;gt;&amp;lt;a href=&amp;quot;http://www.pledgie.com/campaigns/20016.png?skin_name=chrome&amp;quot;&amp;gt;http://www.pledgie.com/campaigns/20016.png?skin_name=chrome&amp;lt; /a&amp;gt;&amp;lt;/p&amp;gt;

&amp;lt;p&amp;gt;宝宝（我的，6周岁）半哭，更像是咕哝和用力呼吸。  奶嘴的叮当声。&amp;lt;/p&amp;gt;

&amp;lt;p&amp;gt;在家里录制，2006年1月11日。AKG C4000B话筒，带ProTools LE和Mbox的Macintosh。 &amp;lt;/p&amp;gt;

&amp;lt;p&amp;gt;目的是为了记录他有时发出的奇怪的声音，但一旦录音，他就会怯场或什么的。&amp;lt;/p&amp;gt;

&amp;lt;p&amp;gt;宝宝（我的，6周岁）在哭（和往常一样）。  三声长哭，中间有几声较短的半哭声或呻吟声。

&amp;lt;p&amp;gt;2006年1月11日，在家里录制的。  AKG C4000B话筒，Macintosh与ProTools LE和Mbox.&amp;lt;/p&amp;gt;

&amp;lt;p&amp;gt;目的是为了记录他有时发出的奇怪的声音，但一旦录音，他就会怯场或什么的。&amp;lt;/p&amp;gt;

&amp;lt;p&amp;gt;宝宝（我的，6周岁）在哭（和往常一样）。一声短的哭声之后是三声较长的哭声，然后是一点暴躁的呻吟声&amp;lt;/p&amp;gt。

&amp;lt;p&amp;gt;在家里录制，2006年1月11日。  AKG C4000B话筒，Macintosh与ProTools LE和Mbox.&amp;lt;/p&amp;gt;

&amp;lt;p&amp;gt;目的是为了记录他有时发出的奇怪的声音，但一旦录音，他就会怯场或什么的。&amp;lt;/p&amp;gt;

&amp;lt;p&amp;gt;宝宝（我的，6周岁）在哭。  较小的哭声变成较大的长哭声。  橡皮奶嘴的声音，然后通过橡皮奶嘴发出咕噜咕噜的哭声，&amp;lt;/p&amp;gt;

&amp;lt;p&amp;gt;2006年1月11日，在家里录制的。AKG C4000B话筒，带ProTools LE和Mbox的Macintosh。 &amp;lt;/p&amp;gt;

&amp;lt;p&amp;gt;目的是为了记录他有时发出的奇怪的声音，但一旦录音，他就会怯场或什么的。&amp;lt;/p&amp;gt;

&amp;lt;p&amp;gt;宝宝（我的，6周岁）在哭。两声噼里啪啦的半哭半闹声&amp;lt;br&amp;gt;接着是短促的断断续续的哭声，一声比一声大，还有一些&amp;lt;br&amp;gt;呻吟声&amp;lt;/p&amp;gt。

&amp;lt;p&amp;gt;在家里录制，2006年1月11日。AKG C4000B话筒，Macintosh与ProTools LE和Mbox.&amp;lt;/p&amp;gt;

&amp;lt;p&amp;gt;目的是为了记录他有时发出的奇怪的声音，但一旦录音，他就会怯场或什么的。&amp;lt;/p&amp;gt;

&amp;lt;p&amp;gt;一个婴儿在院子里哭。&amp;lt;/p&amp;gt。

&amp;lt;p&amp;gt;过了半分钟，我才停止恼怒，意识到我被声音的礼物所祝福。&amp;lt;/p&amp;gt。

&amp;lt;p&amp;gt;用Zoom H2录制的。用Audacity编辑。&amp;lt;/p&amp;gt;

&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;这不是一个公共领域的声音!这个声音需要署名！&amp;lt;/strong&amp;gt; 如果你不能署名，&amp;lt;a href=&amp;quot;http://www.freesound.org/people/qubodup/&amp;quot; rel=&amp;quot;nofollow&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;联系我&amp;lt;/strong&amp;gt; &amp;lt;/a&amp;gt;！&amp;lt;/p&amp;gt;

&amp;lt;p&amp;gt;您需要以以下形式注明出处：&amp;lt;br&amp;gt;&amp;lt;/p&amp;gt;&amp;lt;blockquote&amp;gt;&amp;lt;strong&amp;gt;[在此插入声音标题]&amp;lt;/strong&amp;gt; Copyright 2013 &amp;lt;a href=&amp;quot; http://qubodup.net&amp;quot; rel=&amp;quot;nofollow&amp;quot;&amp;gt;Iwan Gabovitch&amp;lt;/a&amp;gt;, &amp;lt;a href=&amp;quot;http://creativecommons.org/licenses/by/3.0/&amp;quot; rel=&amp;quot;nofollow&amp;quot;&amp;gt;CC-BY3许可&amp;lt;/a&amp;gt;。&amp;lt;/blockquote&amp;gt;&amp;lt;br&amp;gt;&amp;lt;a href=&amp;quot;http://qubodup.wordpress.com/2012/08/16/audio-use-flac-instead-of-aiff-and-wave-use-vorbis-instead-of-mp3/&amp;quot; rel=&amp;quot;nofollow&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;&amp;lt;a href=&amp;quot;http://farm9.staticflickr.com/8070/8213683889_517a10ef52_o.png&amp;quot;&amp;gt;http://farm9.staticflickr.com/8070/8213683889_517a10ef52_o.png&amp;lt;/a&amp;gt;&amp;lt;br&amp;gt;关于FLAC和OGG Vorbis音频文件格式&amp;lt;/strong&amp;gt;&amp;lt;/a&amp;gt; 。

&amp;lt;p&amp;gt;&amp;lt;a href=&amp;quot;http://www.freesound.org/people/qubodup/&amp;quot; rel=&amp;quot;nofollow&amp;quot;&amp;gt;&amp;lt;strong&amp;gt;联系我&amp;lt;/strong&amp;gt;&amp;lt;/a&amp;gt;如果你对开放源代码或商业用途的特定声音感兴趣.&amp;lt;/p&amp;gt。
